            cmb.DataSource = Enum.GetNames(typeof(MAVLink.MAVLINK_MSG_ID)).ToSortedList((s, s1) => s.CompareTo(s1));
            cmb.Width += 50;
            Button but = new Button();
            but.Text = "Set";
